import React from 'react';
import Navbar from '../Navbar/Navbar';
import './Style.css'

function Home(props) {
    const card = [
        {Name : " ", extra : "", img : ""},
        {Name : " ", extra : "", img : ""},
        {Name : " ", extra : "", img : ""},
        {Name : " ", extra : "", img : ""},
    ]
    return (
        <React.Fragment>
            <header>
                <Navbar />
            </header>
            <div className="body w-75 border-left border-right">
                <div className="p-3 h2 ">Welcome to Caleb Mobile Waiter CWM</div>
                <div className="txt2">
                    Make orders with us and get your order under 1 hour <br />
                   Note : No refunds
               </div>
                <button className="ord-btn btn  btn-outline btn-info btn-info-outline" onClick={() => {
                    window.location.assign('/order')
                }}>
                    Order
               </button>
               <div className="card col-lg-6 m-auto" style={{backgroundColor:"url('../images/download (1).jpeg')"}}>
                    <img src="../images/download (1).jpeg" alt="" height="300px"/>
               </div>
            </div>
        </React.Fragment>
    );
}
export default Home;
